import React from 'react';

export const Header = () => {
    return(

        <div className="bg-light opacity-75 text-center py-2 header">
          <a href="#" className="headerLogoLink">
              <img src="/images/GuruCool_Logo.png" className="img-fluid Logo"  alt="GuruCool" />
              <img src="/images/GuruCool_Logo_F.png" className="img-fluid LogoTemplate"  alt="GuruCool" /> 
          </a>
        </div>
    )
}
